            <h5 className="text-center card-title">ID: {props.codigo} - {props.descricao}</h5>
            <div className="d-flex">
                
            </div>
            <a href="/backup/:idbackup" className="btn btn-primary btn-sm">Visualizar</a>
          </div>
        </div>
      </div>
    );
  }
  
